import React from 'react';
import './App.css';
import { NeuCard, NeuHeading, NeuProgressBar } from 'neumorphic-ui';

function App() {
  return (
    <div>
      <p>Hello World</p>
      <NeuHeading text="NOME" />

      <NeuProgressBar progress="50%" />

      <NeuCard width="600px" height="300px" >
        <p>Testing inside the card</p>
      </NeuCard>
    </div>
  );
}

export default App;
